import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
    <div className={`App ${fadeIn ? "fade-in" : ""}`}>
      <App />
    </div>
     </BrowserRouter>
  </React.StrictMode>
);
